    false,nt"url": null,nt"notes": "In Region 3, and to some extent in Region
    6, prairie reconstructions (planting native prairie plants on lands formerly under
    row crop agriculture) are one of the most frequent land management actions employed
    by refuge managers and they are among the most costly and long-lasting of management
    actions. Grassland bird populations and many other prairie obligate biota (bees,
    butterflies, etc.) are in steep decline due to loss of habitat; reconstructions
    are one tool for slowing this trend and represent a major contribution of the NWRS
    to supporting these populations.This is the first step in a process that will ultimately
    involve monitoring protocols to measure the response of these populations to grassland
    management practices in Regions 3 and 6.",nt"license_title": "License Not
